INSERT INTO `articles` VALUES (2,115,2,'Sortie des élèves aux Célestins','Le 24 mars dernier nous avons emmener les ados assister à Georges Dandin dans le magnifique théâtre des Célestins.\r\nLa soirée à d\'abord commencé par un repas au resto/cafet du théâtre \"l\'Etourdi\" puis nous nous sommes dirigés vers nos places respectives dans cette salle magnifique des Célestins. Un théâtre à l\'ancienne comme on en fait plus, avec 3 balcons, des lustres magnifiques, le plafond entièrement peint par divers artistes, des moulures splendides, c\'est un décor à vous couper le souffle.',NULL,'9c349c94e50be92328bfd1878fb18b10.png','Provident et esse eligendi molestias fuga tenetur inventore. Error pariatur suscipit est et eaque at iste.','Les ados ont pu assister à une pièce de Molière dans le plus beau théâtre de Lyon'),(3,115,3,'Hôtes Tensions de Franck Didier.','Venez nombreux au nouveau spectacle de la troupe de Ternay \r\nqui aura lieu au foyer rural de Ternay, les :\r\nJeudi 15 mars à 20h30\r\nVendredi 16 mars à 20h30\r\nSamedi 17 mars à 20h30\r\nDimanche 18 mars à 16h00',NULL,'9fdfd3c79ed6593a767c05fb4da8a52e.pdf','Mollitia vero modi dolores veritatis ipsa. Alias necessitatibus voluptate ab vitae debitis et.','Troupe de Ternay'),(5,115,2,'Me.','Autem omnis ipsa amet provident. Sit earum est hic possimus et eum tempora. Deserunt rerum atque maxime aperiam qui.',NULL,'https://lorempixel.com/https://placehold.it/350x1350/480/?61550','Culpa ut quisquam consequuntur voluptas voluptatem voluptatem excepturi. Quo a et quod. Aut reiciendis nisi dolorem quia minima illum non.','Consequuntur totam dolores in iste quo omnis. Repudiandae maiores soluta odit qui eum dicta aut est.'),(6,115,2,'Me.','Repudiandae qui laborum id sunt aut. Quos doloremque deserunt incidunt incidunt dolore. Molestiae dolore ipsam commodi nihil unde.',NULL,'https://lorempixel.com/https://placehold.it/350x1350/480/?28529','Doloremque at sunt corporis est reiciendis. Ex quis cum modi ea.','Voluptatum id nihi