INSERT INTO `spectacles` VALUES (3,'3f9d922736e7fed66bd2befd03fb3bb8.jpeg','L\'art de la fugue','Cela fait plusieurs semaines qu’on est sans nouvelle de la locataire du premier étage quand le chat de Mme  Poulard disparaît à son tour.\r\n                                Il se passe de drôles de choses au 2 rue Jean-Sébastien Bach et le calme habituel du quartier va très vite se fissurer.\r\n                                Les personnages se croisent et se racontent, rebondissements et révélations se succèdent lors de cette journée pas comme les autres.'),(7,'6a065e64351629dcb60376ff608aa0c3.jpeg','Veillée funèbre','Cela fait plusieurs semaines qu’on est sans nouvelle de la locataire du premier étage quand le chat de Mme Poulard disparaît à son tour. Il se passe de drôles de choses au 2 rue Jean-Sébastien Bach et le calme habituel du quartier va très vite se fissurer. Les personnages se croisent et se racontent, rebondissements et révélations se succèdent lors de cette journée pas comme les autres.'),(8,'9c0b301e0d5ce88517222c74d7c710c1.jpeg','L\'orchestre','Cela fait plusieurs semaines qu’on est sans nouvelle de la locataire du premier étage quand le chat de Mme Poulard disparaît à son tour. Il se passe de drôles de choses au 2 rue Jean-Sébastien Bach et le calme habituel du quartier va très vite se fissurer. Les personnages se croisent et se racontent, rebondissements et révélations se succèdent lors de cette journée pas comme les autres.'),(9,'153d15a135f9c86fa7810a8abded2cdf.pdf','Des squelettes dans le placard','Ils pensaient partie en week-end Thalasso mais.......');
/*!40000 ALTER TABLE `spectacles` ENABLE KEYS */;
